package pl.blaszak.ImportandUrgent.utils;import pl.blaszak.ImportandUrgent.model.Settings;import java.util.Comparator;import static java.lang.Long.parseLong;public class SettingsComparator implements Comparator<Settings> {    private static final int TIMESTAMP_BEGIN_INDEX = 0;    private static final int TIMESTAMP_END_INDEX = 8;    @Override    public int compare(Settings settings1, Settings settings2) {        Long timestamp1 = parseLong(settings1.getId().substring(TIMESTAMP_BEGIN_INDEX, TIMESTAMP_END_INDEX));        Long timestamp2 = parseLong(settings2.getId().substring(TIMESTAMP_BEGIN_INDEX, TIMESTAMP_END_INDEX));        return timestamp1.compareTo(timestamp2);    }}